import React from 'react';

const AcneDetectionPage = () => {
    return (
        <div className="container py-5">
            <h2 className="text-center mb-4">Acne Detection</h2>
            <p className="text-center">This feature allows you to upload a photo and detect acne.</p>
            {/* Additional content and functionality for acne detection would go here */}
        </div>
    );
};

export default AcneDetectionPage;
